import React from "react";
import "./footer.css";
import logo from '../../images/logo.webp';

function Footer() {
  return (
    <>
        <div className="container d-flex ">
            <div className="col-lg-6 mt-4">
                <img src={logo} alt="Logo" width="380px" style={{marginBottom:'20px'}}/>

            </div>
            <div className="col-lg-4">
              <h5 className="footerService">PRODUCTS</h5>
              <span className="fServicespan">NovaGenie</span><br/>
              <span className="fServicespan">Change Facilitator</span><br/>
              <span className="fServicespan">Personal Facilitator</span><br/>
              <span  className="fServicespan">Project Z</span><br/>
              <span  className="fServicespan" >Talent 360</span>
            </div>
            <div className="col-lg-4">
              <h6 className="footerService">SERVICE</h6>
            </div>
        </div>
        <div className="d-flex justify-content-between copyWrite">
            <span> &copy; NOVACEPT 2022</span>
            <span>Website Built by Synaesthesia</span>
      </div>
    </>
  );
}
export default Footer;
